import React, { VFC } from 'react'
import { Link } from 'react-router-dom';

const Navigation: VFC = () => {
  return (
    <nav>
      <Link to='/main'>Main</Link>
      <Link to='/profile'>Profile</Link>
      <Link to='/login'>Logout</Link>
    </nav>
  );
};

export default Navigation;
